import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Sidebar from '../../components/Sidebar';
import Notices from './Resident/Notices';
import Payments from './Resident/Payments';
import Complaints from './Resident/Complaints';
import FacilityBooking from './Resident/FacilityBooking';
import VisitorManagement from './Resident/VisitorManagement';
import SocietyFinances from './Resident/SocietyFinances';
import MaintenanceRequest from './Resident/MaintenanceRequest';

const sidebarItems = [
  { label: 'Dashboard', to: '/resident' },
  { label: 'Notices', to: '/resident/notices' },
  { label: 'Payments', to: '/resident/payments' },
  { label: 'Complaints', to: '/resident/complaints' },
  { label: 'Facility Booking', to: '/resident/facility-booking' },
  { label: 'Visitor Management', to: '/resident/visitor-management' },
  { label: 'Society Finances', to: '/resident/society-finances' },
  { label: 'Maintenance Request', to: '/resident/maintenance-request' },
];

export default function ResidentDashboard({ logout }) {
  return (
    <div className="d-flex" style={{ minHeight: '100vh' }}>
      <Sidebar items={sidebarItems} logout={logout} />
      <main className="flex-grow-1 p-4" style={{ backgroundColor: '#E0E1DD' }}>
        <Routes>
          <Route path="/" element={<h2>Welcome to Resident Dashboard</h2>} />
          <Route path="notices" element={<Notices />} />
          <Route path="payments" element={<Payments />} />
          <Route path="complaints" element={<Complaints />} />
          <Route path="facility-booking" element={<FacilityBooking />} />
          <Route path="visitor-management" element={<VisitorManagement />} />
          <Route path="society-finances" element={<SocietyFinances />} />
          <Route path="maintenance-request" element={<MaintenanceRequest />} />
          <Route path="*" element={<Navigate to="/resident" />} />
        </Routes>
      </main>
    </div>
  );
}
